package edu.umontreal.kotlingrad.dependent

// TODO: Maybe extend Vec?
open class Mat<T, Rows: `100`, Cols: `100`> {
  val rowT: Nat<Rows>
  val colT: Nat<Cols>
  val numRows: Int
  val numCols: Int

  /**TODO: Make contents a Vec<Vec<T, MaxCols>, MaxRows>**/
  val contents: List<Vec<T, Cols>>

  constructor(m: Nat<Rows>, n: Nat<Cols>, contents: List<Vec<T, Cols>> = arrayListOf()) {
    this.rowT = m
    this.colT = n
    this.contents = contents
    this.numRows = m.i
    this.numCols = n.i
  }

  operator fun get(i: Int): Vec<T, Cols> = contents[i]

  constructor(m: Nat<Rows>, n: Nat<Cols>, vararg ts: T) : this(m, n, (0 until m.i).map { Vec(n, (0 until n.i).map { ts[it] }) }) {
    if (ts.size != m.i * n.i) throw IllegalArgumentException("Declared ${m.i}x${n.i}, but found ${ts.size}")
  }

